import React from 'react'

function SubItem({item, index}) {
  const{name, isCompleted} = item;
  return (
    <div key={index} style={{display: "flex", alignItems:"baseline", margin: "0px", padding:""}}>
      <p>{index+1}. {name}</p>
      <div id={`details-${index}`} style={{display: 'none', textAlign:"left", paddingLeft: "10px"}}>
        <p >{name}: {(isCompleted)? "Completed": "To do"}</p>
      </div>
    </div>
  )
}

export default SubItem
